import React, { useState, useEffect } from 'react';
import './App.css';
import axios from 'axios';


/*
need axios
*/

function App() {
  const [bids, setBids] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/getBids')
      .then(response => {
        console.log("response: ", response.data);
        console.log("elem: ", response.data[0].Price);
        setBids(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <table>
      {bids.map(bid => (
        <tr>
          <th>{bid.Name}</th> <th>{bid.Price}</th>
        </tr>

      ))}
    </table>
  );
}

export default App;
